    @SuppressWarnings("unchecked")
    public static void bidui() throws Exception, IOException {
        String[] qunarss = qunarsss.split(",");
        for (int i = 0; i < qunarss.length; i++) {
            String[] qunars = qunarss[i].split("\\|");
            String qunarordernumberr = qunars[0];
            String refundprice = qunars[1];
            try {
                List list = Server
                        .getInstance()
                        .getSystemService()
                        .findMapResultByProcedure(
                                "[sp_Trainorder_qunar_refund_bidui] @qunarordernumber='" + qunarordernumberr + "'");
                if (list.size() > 0) {
                    Map map = (Map) list.get(0);
                    String os = map.get("os").toString();
                    if (Integer.valueOf(os) == 8 || Integer.valueOf(os) == 6) {
                        WriteLog.write("qunar价格比对_拒单_" + os, qunarordernumberr + "--->" + refundprice);
                        continue;
                    }
                    if (Integer.valueOf(os) != 3) {
                        WriteLog.write("qunar价格比对_状态不对_" + os, qunarordernumberr + "--->" + refundprice);
                        continue;
                    }
                    float price = Float.valueOf(map.get("price").toString());
                    if (map.get("pd") == null) {
                        WriteLog.write("qunar价格比对_DB无退款记录", qunarordernumberr + "--->" + refundprice + "===>DB订单总价:"
                                + price);
                        continue;
                    }
                    float pd = Float.valueOf(map.get("pd") == null ? "0" : map.get("pd").toString());
                    if (price - pd != Float.valueOf(refundprice == null || "".equals(refundprice) ? "0" : refundprice)) {
                        WriteLog.write("qunar价格比对_价格不对", qunarordernumberr + "--->" + refundprice + "===>DB订单总价:"
                                + price + "===>DB退票总手续费:" + pd);
                        continue;
                    }
                    else {
                        WriteLog.write("qunar价格比对_没有问题", qunarordernumberr + "--->" + refundprice + "===>DB订单总价:"
                                + price + "===>DB退票总手续费:" + pd);
                        continue;
                    }
                }
                else {
                    WriteLog.write("qunar价格比对_没有这个订单号", qunarordernumberr + "--->" + refundprice);
                }
            }
            catch (Exception e) {
                WriteLog.write("qunar价格比对_异常", qunarordernumberr + "--->" + refundprice);
                ExceptionUtil.writelogByException("qunar价格比对_异常", e);
            }
        }
    }
